import { useState, useEffect } from "react"

import OfferService from "../services/offer.service";

const GetCategories = () => {
    const [ data, setData ] = useState([]);

    useEffect(() => {
        OfferService.getCategories().then((category) =>
        setData(category.data)
    );
    }, [])

    return [ data, setData]
}

export default GetCategories;
